text:
 @willianwagnerzero  Sí, prefiero sobre proteger EN ALGO QUE DA BIENESTAR REAL, que sobre-protegerlos por ejemplo negándoles experiencias en el mundo real: que ayuden en casa, que laven, planchen, cocinen, lean, manejen patines, bicicleta, natación, poca o nula mesada o propina.

Internet es un placer que los vuelve sexosos, si quieres tú dales internet a tus hijos desde bbs, expónlos a la excrescencia, la única sobreprotección válida es quitarles internet porque les yode el cerebro, les yode su personalidad, los hace adictos a la dopamina.

Ya quiero ver a tus hijos o a ti mismo adicto al internet y siendo so pa jin.
